import * as React from 'react';
import Logo from '../Images/Logo.png';
import {Link} from "react-router-dom";
import './topbar.css';

export function TopBar() {
    return (
        <div>
            <nav className="navbar topBarHead">
                <div className="container topBarContent">
                    <Link to="/" className={`topBarLogoHead`}>
                        <img src={Logo} alt="Starwars" className={`topBarLogo`} />
                    </Link>
                    <form className="d-flex inputSearchForm" role="search">
                        <input className="form-control searchInput" type="search" placeholder="Search" aria-label="Search"/>

                    </form>
                </div>
            </nav>

        </div>
    );
}
